pragma solidity ^0.5.12;
import "./IERC721.sol";
import "./IERC721Receiver.sol";
import "./Ownable.sol";

contract P2PContract is IERC721, Ownable{

    string public constant dAppName = "P2PMarketplace";
    string public constant globalTokenSymbol = "CKTY";
    uint256 public constant gen0_P2PLimit = 10;

    bytes4 internal constant IERC721ReturnValue = bytes4(keccak256("onERC721Received(address,address,uint256,bytes)"));

    bytes4 private constant _INTERFACE_ID_ERC721 = 0x80ac58cd;

    bytes4 private constant _INTERFACE_ID_ERC165 = 0x01ffc9a7;

    uint256 public gen0_P2PCounter;

    function supportsInterface(bytes4 _interfaceId) external pure returns(bool){
        return (_interfaceId == _INTERFACE_ID_ERC165 || _interfaceId == _INTERFACE_ID_ERC721);
    }

    struct P2P {
        uint256 genes;
        uint64 birthTime;
        uint32 momId;
        uint32 dadId;
        uint16 generation;  
    }

    P2P[] itemsForOffer;

    mapping (uint256 => address) public P2PIndextoOwner;
    mapping (address => uint256) P2POwnershipCount;
    mapping (uint256 => address) public P2PIndexToApproved;

    //Double Mapping for Approve All Tokens Functions (MyAddress => OperatorAddress => True/False) 
    mapping (address => mapping (address => bool)) public  _operatorApprovals;


    event Birth(address owner, uint256 kittenId, uint256 momId, uint256 dadId, uint256 genes);

    function balanceOf(address owner) external view returns (uint256){
        return P2POwnershipCount[owner];
    }

    /*
     * @dev Returns the total number of tokens in circulation.
     */
    function totalSupply() external view returns (uint256){
        return itemsForOffer.length;
    }

    /*
     * @dev Returns the name of the token.
     */
    function name() external view returns (string memory){
        return dAppName;
    }

    /*
     * @dev Returns the symbol of the token.
     */
    function symbol() external view returns (string memory){
        return globalTokenSymbol;
    }

    /**
     * @dev Returns the owner of the `tokenId` token.
     *
     * Requirements:
     *
     * - `tokenId` must exist.
     */
    function ownerOf(uint256 _tokenId) external view returns (address){
        return P2PIndextoOwner[_tokenId];
    }


     /* @dev Transfers `tokenId` token from `msg.sender` to `to`.
     * Requirements:
     * - `to` cannot be the zero address.
     * - `to` can not be the contract address.
     * - `tokenId` token must be owned by `msg.sender`.
     * Emits a {Transfer} event.
     */
    function transfer(address to, uint256 tokenId) external{
        require(to != address(0x0),'Address Cannot be NULL');
        require(to != address(this),'Address Cannot be Origination Contract');
        require(P2PIndextoOwner[tokenId] == msg.sender, 'Sender Must be Owner');

        _transfer(msg.sender, to, tokenId);
    }

// Internal function which will be used by transfer to swap token ownership
    function _transfer(address _from, address _to, uint256 _tokenId) internal {
        P2POwnershipCount[_to] ++;
        // check to see if gen0 kat
        if (_from != address(0x0)){
            P2POwnershipCount[_from] --;
            delete P2PIndexToApproved[_tokenId];
        }

        P2PIndextoOwner[_tokenId] = _to;

        emit Transfer(_from, _to, _tokenId);
    }


// CREATE/BREED NEW CAT FUNCTION 
    function _createP2P(uint256 _momId, uint256 _dadId, uint256 _generation, uint256 _genes, address _owner) internal returns(uint256){

        P2P memory _P2P = P2P({
            genes: _genes,
            birthTime: uint64(now),
            momId: uint32(_momId),
            dadId: uint32(_dadId),
            generation: uint16(_generation)
        });

        itemsForOffer.push(_P2P);

        uint256 newKittenId = (itemsForOffer.length)-1;

        _transfer(address(0x0), _owner, newKittenId);

        emit Birth(_owner, newKittenId, _momId, _dadId, _genes);

        return newKittenId;
    }


// CREATE GENERATION 0 KAT WITH NO PARENTS
// OnlyOwner to prevent every user from generating Gen 0 and flooding market
    function createP2PGen0(uint256 _genes) public onlyOwner returns (uint256) {
        require(gen0_P2PCounter < gen0_P2PLimit, "No more Gen0 itemsForOffer Allowed");

        gen0_P2PCounter++;

        return _createP2P((0x0), (0x0), 0, _genes, msg.sender);
    }

//Get P2P Info Function
//Input P2P and get out all cat details
    function getP2PInfo(uint256 P2P_index) external view 
    returns (
        uint256 genes, 
        uint256 birthTime, 
        uint256 momId, 
        uint256 dadId, 
        uint256 generation)
            {
                P2P storage P2PInfo = itemsForOffer[P2P_index];

                genes = P2PInfo.genes;
                birthTime = uint256(P2PInfo.birthTime); 
                momId = uint256(P2PInfo.momId); 
                dadId = uint256(P2PInfo.dadId);
                generation = uint256(P2PInfo.generation);
            }

    function approve(address _approved, uint256 _tokenId) external{
        require(
            P2PIndextoOwner[_tokenId] == msg.sender || 
            P2PIndexToApproved[_tokenId] == msg.sender || 
            _operatorApprovals[P2PIndextoOwner[_tokenId]][msg.sender] == true, "Message.Sender must be Token Owner");

        _approve(_approved, _tokenId);
    }

    function _approve(address _approved, uint256 _tokenId) internal{

        P2PIndexToApproved[_tokenId] = _approved;

        emit Approval(P2PIndextoOwner[_tokenId], _approved, _tokenId);
    }

    function setApprovalForAll(address _operator, bool _approved) external{
        require(_approved = true || false, "Must Enter True or False");
        require(_operator != msg.sender, "Cannot approve yourself");
        require(_operator != address (0x0), "Cannot Approve a Zero Address");

        _approvalForAll(_operator, _approved);
    }

    function _approvalForAll(address _operator, bool _approved) internal {
        _operatorApprovals[msg.sender][_operator] = _approved;

        emit ApprovalForAll(msg.sender, _operator, _approved);
    }

    function getApproved(uint256 _tokenId) external view returns (address){
        require((_tokenId < itemsForOffer.length), 'Must be a valid P2P');

        return (P2PIndexToApproved[_tokenId]);
    }

    function isApprovedForAll(address _owner, address _operator) external view returns (bool){
        return _operatorApprovals[_owner][_operator];
    }

    function safeTransferFrom(address _from, address _to, uint256 _tokenId, bytes memory data) public{
        require( _checkTransferParameters(_from, _to, _tokenId) , "Message.Sender must be Token Owner, or Approved by Owner");
        _safeTransfer(_from, _to, _tokenId, data);

    }

    function safeTransferFrom(address _from, address _to, uint256 _tokenId) external{
        safeTransferFrom(_from, _to, _tokenId, "");
    }


    function transferFrom(address _from, address _to, uint256 _tokenId) external{
        require( _checkTransferParameters(_from, _to, _tokenId) , "Message.Sender must be Token Owner, or Approved by Owner");
        _transfer(_from, _to, _tokenId);
    }

    function _safeTransfer(address _from, address _to, uint256 _tokenId, bytes memory _data) internal {
        _transfer(_from, _to, _tokenId);
        require(_checkERC721Support(_from, _to, _tokenId, _data), "To Address Must be Capable of Receiving Token");
    }

    function _checkERC721Support(address _from, address _to, uint256 _tokenId, bytes memory _data) internal returns(bool){
        if( !_isContract(_to) ){
            return true;
        }

        //Call onERC721Received at _to address
        bytes4 returnData = IERC721Receiver(_to).onERC721Received(msg.sender, _from, _tokenId, _data);

        //Check that return value is equal to ERC721 token standards
        return returnData == IERC721ReturnValue;
    }

    function _isContract(address _to) view internal returns(bool){
            uint32 size;
            assembly{
                size := extcodesize(_to)
            }
            return size > 0;
    }

    function _checkTransferParameters(address _from, address _to, uint256 _tokenId) internal view returns(bool){
        require(_from == msg.sender || P2PIndexToApproved[_tokenId] == msg.sender || _operatorApprovals[P2PIndextoOwner[_tokenId]][msg.sender], "Message.Sender must be Token Owner, or Approved by Owner");
        require(P2PIndextoOwner[_tokenId] == _from, "From Address must be P2P Owner");
        require(_to != address (0x0), "Cannot Send to a Zero Address");
        require((_tokenId < itemsForOffer.length), 'Must be a valid P2P');

        return true;
    }

    function _checkOwnership(address _toCheck, uint256 _tokenId) internal view returns(bool){
        require(_toCheck == P2PIndextoOwner[_tokenId], "Message.Sender must be Token Owner, or Approved by Owner");
        return true;
    }
}

